import React from "react";

const firstName = "Bob",
  lastName = "Seiger",
  date = new Date();
// Content component
// using string templating from es6
const Content = () => (
  <div>
    <main>Content</main>
    <p>Hello, {`${firstName} ${lastName}`}</p>
    <p>It is currently about, {date.getHours() % 12} o'clock</p>
  </div>
);

export default Content;
